import React, { useState, useEffect } from 'react';
import './AdminPanel.css';

const AdminPanel = () => {
  const [stats, setStats] = useState({
    totalQuestions: 0,
    todayQuestions: 0,
    activeUsers: 0,
    avgResponseTime: '1.2s'
  });

  const [recentQuestions, setRecentQuestions] = useState([
    {
      id: 1,
      question: "ŸÉŸäŸÅ ÿ£ÿ≥ÿ¨ŸÑ ÿßŸÑŸÖŸàÿßÿØÿü",
      category: "ÿ™ÿ≥ÿ¨ŸäŸÑ",
      timestamp: new Date(Date.now() - 1000 * 60 * 5), // 5 ÿØŸÇÿßÿ¶ŸÇ ŸÖÿ∂ÿ™
      status: "answered"
    },
    {
      id: 2,
      question: "ŸÖÿß ŸáŸä ÿ£ŸàŸÇÿßÿ™ ÿßŸÑŸÖŸÉÿ™ÿ®ÿ©ÿü",
      category: "ÿÆÿØŸÖÿßÿ™",
      timestamp: new Date(Date.now() - 1000 * 60 * 15), // 15 ÿØŸÇŸäŸÇÿ© ŸÖÿ∂ÿ™
      status: "answered"
    },
    {
      id: 3,
      question: "ŸÖÿπŸÑŸàŸÖÿßÿ™ ÿπŸÜ ÿ™ÿÆÿµÿµ ÿπŸÑŸàŸÖ ÿßŸÑÿ≠ÿßÿ≥Ÿàÿ®",
      category: "ÿ£ŸÉÿßÿØŸäŸÖŸä",
      timestamp: new Date(Date.now() - 1000 * 60 * 30), // 30 ÿØŸÇŸäŸÇÿ© ŸÖÿ∂ÿ™
      status: "pending"
    }
  ]);

  const [selectedCategory, setSelectedCategory] = useState('all');

  useEffect(() => {
    // ŸÖÿ≠ÿßŸÉÿßÿ© ÿ™ÿ≠ÿØŸäÿ´ ÿßŸÑÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™
    const updateStats = () => {
      setStats(prev => ({
        ...prev,
        totalQuestions: prev.totalQuestions + Math.floor(Math.random() * 3),
        todayQuestions: prev.todayQuestions + Math.floor(Math.random() * 2),
        activeUsers: Math.floor(Math.random() * 50) + 10
      }));
    };

    const interval = setInterval(updateStats, 10000); // ÿ™ÿ≠ÿØŸäÿ´ ŸÉŸÑ 10 ÿ´ŸàÿßŸÜŸä
    return () => clearInterval(interval);
  }, []);

  const categories = ['all', 'ÿ™ÿ≥ÿ¨ŸäŸÑ', 'ÿÆÿØŸÖÿßÿ™', 'ÿ£ŸÉÿßÿØŸäŸÖŸä', 'ÿ™ŸÇŸÜŸä'];

  const filteredQuestions = selectedCategory === 'all' 
    ? recentQuestions 
    : recentQuestions.filter(q => q.category === selectedCategory);

  const getStatusColor = (status) => {
    switch(status) {
      case 'answered': return '#4caf50';
      case 'pending': return '#ff9800';
      case 'urgent': return '#f44336';
      default: return '#9e9e9e';
    }
  };

  const formatTime = (timestamp) => {
    const now = new Date();
    const diff = now - timestamp;
    const minutes = Math.floor(diff / (1000 * 60));
    
    if (minutes < 1) return 'ÿßŸÑÿ¢ŸÜ';
    if (minutes < 60) return `${minutes} ÿØŸÇŸäŸÇÿ© ŸÖÿ∂ÿ™`;
    
    const hours = Math.floor(minutes / 60);
    if (hours < 24) return `${hours} ÿ≥ÿßÿπÿ© ŸÖÿ∂ÿ™`;
    
    const days = Math.floor(hours / 24);
    return `${days} ŸäŸàŸÖ ŸÖÿ∂Ÿâ`;
  };

  return (
    <div className="admin-panel">
      <header className="admin-header">
        <h1>üìä ŸÑŸàÿ≠ÿ© ÿßŸÑÿ™ÿ≠ŸÉŸÖ - Ask MEU</h1>
        <p>ÿ•ÿØÿßÿ±ÿ© ŸàŸÖÿ±ÿßŸÇÿ®ÿ© ÿßÿ≥ÿ™ŸÅÿ≥ÿßÿ±ÿßÿ™ ÿßŸÑÿ∑ŸÑÿßÿ®</p>
      </header>

      {/* ÿßŸÑÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿßŸÑÿ≥ÿ±Ÿäÿπÿ© */}
      <section className="stats-section">
        <div className="stats-grid">
          <div className="stat-card">
            <div className="stat-icon">üí¨</div>
            <div className="stat-info">
              <span className="stat-number">{stats.totalQuestions}</span>
              <span className="stat-label">ÿ•ÿ¨ŸÖÿßŸÑŸä ÿßŸÑÿ£ÿ≥ÿ¶ŸÑÿ©</span>
            </div>
          </div>
          
          <div className="stat-card">
